import React from "react";
import ReactDOM from "react-dom";
import AboutMe from "./components/aboutMe.jsx";
import TechnicalStuff from "./components/technicalStuff.jsx";
import FindMe from "./components/findMe.jsx";
import FunStuff from "./components/funStuff.jsx";
import "./styles/index.css";

let aboutText =
  "Hello! I am a senior at the University of Pennsylvania, a proud alumnus of Central High school (275!), and a candidate for a Bachelor of Science in Engineering degree. I am majoring in computer science with a minor in mathematics. " +
  "Upon completion of my degree I will be a fulltime software developer at Publicis Sapient in the company's Chicago office.";

aboutText =
  "Hello! My name is Aavo. I hail from Tartu, Estonia, but I grew up in Philly. ";

ReactDOM.render(
  <div>
    <AboutMe about={aboutText} />
    <TechnicalStuff />
  </div>,
  document.getElementById("root")
);
